function [F,rmin,res] = mlorthoF_cm(x,y)
% function [F,rmin,res] = mlorthoF_cm(x,y)
%
% Estimates the maximum likelihood orthographic essential matrix given 
% a number of point correspondences.
% input x: 2xn matrix, the n input points in view one (x and y coordinate(
% input y: 2xn matrix, the corresponding n input points in view two.
% Output F: 5x1 vector, the estimated essential matrix (the non-zero
% elements).
% Output rmin: the function value of the best local minimum
% Output res: the vector of all local minima


nn = length(x);
xm = mean(x,2);
ym = mean(y,2);
x = x-repmat(xm,1,nn);
y = y-repmat(ym,1,nn);
x1 = x(1,:);
x2 = x(2,:);
y1 = y(1,:);
y2 = y(2,:);

X = [x1' x2' y1' y2'];
M = X'*X;

m11 = M(1,1);
m12 = M(1,2);
m13 = M(1,3);
m14 = M(1,4);
m22 = M(2,2);
m23 = M(2,3);
m24 = M(2,4);
m33 = M(3,3);
m34 = M(3,4);
m44 = M(4,4);

den = [ 1, - m11 - m22, - m12^2 + m11*m22, -m33, - m13^2 - m23^2 + m11*m33 + m22*m33, m33*m12^2 - 2*m12*m13*m23 + m22*m13^2 + m11*m23^2 - m11*m22*m33];


[q0,q1,q2,q3,q4,q5,q6,q7,q8,cca,ccb,ccc] = setup_mlortho(m11,m12,m13,m14,m22,m23,m24,m33,m34,m44);


sol_l = (roots([q8 q7 q6 q5 q4 q3 q2 q1 q0]));


nsol = 2*length(sol_l);
%keyboard


cc_eq_g = [ m11*m22 - sol_l*m22 - sol_l*m11 + sol_l.^2 - m12^2, m11*m23^2 - sol_l*m14^2 - sol_l*m23^2 - sol_l*m24^2 - sol_l.^2*m33 - sol_l.^2*m44 - sol_l*m13^2 + m11*m24^2 + m13^2*m22 + m14^2*m22 + m12^2*m33 + m12^2*m44 + sol_l*m11*m33 + sol_l*m11*m44 + sol_l*m22*m33 + sol_l*m22*m44 - 2*m12*m13*m23 - 2*m12*m14*m24 - m11*m22*m33 - m11*m22*m44, m13^2*m24^2 - sol_l.^2*m34^2 + m14^2*m23^2 + m12^2*m34^2 + sol_l*m11*m34^2 + sol_l*m14^2*m33 + sol_l*m22*m34^2 + sol_l*m13^2*m44 + sol_l*m24^2*m33 + sol_l*m23^2*m44 + sol_l.^2*m33*m44 - m11*m22*m34^2 - m11*m24^2*m33 - m14^2*m22*m33 - m11*m23^2*m44 - m13^2*m22*m44 - m12^2*m33*m44 - 2*sol_l*m13*m14*m34 - 2*sol_l*m23*m24*m34 - sol_l*m11*m33*m44 - sol_l*m22*m33*m44 - 2*m13*m14*m23*m24 - 2*m12*m13*m24*m34 - 2*m12*m14*m23*m34 + 2*m12*m14*m24*m33 + 2*m13*m14*m22*m34 + 2*m11*m23*m24*m34 + 2*m12*m13*m23*m44 + m11*m22*m33*m44];

sol_g1=-(cc_eq_g(:,2) + sqrt(cc_eq_g(:,2).^2 - 4*cc_eq_g(:,1).*cc_eq_g(:,3)))./(2*cc_eq_g(:,1));
sol_g2=-(cc_eq_g(:,2) - sqrt(cc_eq_g(:,2).^2 - 4*cc_eq_g(:,1).*cc_eq_g(:,3)))./(2*cc_eq_g(:,1));

sol_l2 = [sol_l;sol_l];
sol_g = [sol_g1;sol_g2];

denny = den*[ sol_g.*sol_l2.^2, sol_g.*sol_l2, sol_g, sol_l2.^2, sol_l2, ones(nsol,1)]';
sol_a = (cca*[ sol_g.*sol_l2, sol_g, sol_l2, ones(nsol,1)]')./denny;
sol_b = (ccb*[ sol_g.*sol_l2, sol_g, sol_l2, ones(nsol,1)]')./denny;
sol_c = (ccc*[ sol_l2.^2, sol_l2, ones(nsol,1)]')./denny;
sol_d = ones(1,nsol);
n1 = sqrt(sol_a.^2+sol_b.^2);
n2 = sqrt(sol_c.^2+sol_d.^2);
sol_a = sol_a./n1;
sol_b = sol_b./n1;
sol_c = sol_c./n2;
sol_d = sol_d./n2;

sol_e = -xm(1)*sol_a-xm(2)*sol_b-ym(1)*sol_c-ym(2)*sol_d;

sol_X = [sol_a;sol_b;sol_c;sol_d];
res = sqrt(abs(sum(sol_X.*(M*sol_X))));



[rmin,id]=min(res);


F = [sol_a(id) sol_b(id) sol_c(id) sol_d(id) sol_e(id)]';



function [q0,q1,q2,q3,q4,q5,q6,q7,q8,cca,ccb,ccc] = setup_mlortho(m11,m12,m13,m14,m22,m23,m24,m33,m34,m44)

