ccb = [ m24, m12*m14 - m11*m24, m23*m34 - m24*m33, m13*m14*m23 - m13^2*m24 + m12*m13*m34 - m12*m14*m33 - m11*m23*m34 + m11*m24*m33];
% [ g*l, g, l, 1]
ccc = [ m34, m13*m14 - m11*m34 + m23*m24 - m22*m34, m12*m13*m24 - m12^2*m34 + m12*m14*m23 - m13*m14*m22 - m11*m23*m24 + m11*m22*m34];
