den = [ 1, - m11 - m22, - m12^2 + m11*m22, -m33, - m13^2 - m23^2 + m11*m33 + m22*m33, m33*m12^2 - 2*m12*m13*m23 + m22*m13^2 + m11*m23^2 - m11*m22*m33];
% [ g*l^2, g*l, g, l^2, l, 1]

%cc_eq1 = [ -den(1)^2, -2*den(1)*den(2), cca(1)^2 + ccb(1)^2 - den(2)^2 - 2*den(1)*den(3), 2*cca(1)*cca(2) + 2*ccb(1)*ccb(2) - 2*den(2)*den(3), cca(2)^2 + ccb(2)^2 - den(3)^2, -2*den(1)*den(4), - 2*den(1)*den(5) - 2*den(2)*den(4), 2*cca(1)*cca(3) + 2*ccb(1)*ccb(3) - 2*den(1)*den(6) - 2*den(2)*den(5) - 2*den(3)*den(4), 2*cca(1)*cca(4) + 2*cca(2)*cca(3) + 2*ccb(1)*ccb(4) + 2*ccb(2)*ccb(3) - 2*den(2)*den(6) - 2*den(3)*den(5), 2*cca(2)*cca(4) + 2*ccb(2)*ccb(4) - 2*den(3)*den(6), - ccc(1)^2 - den(4)^2, - 2*ccc(1)*ccc(2) - 2*den(4)*den(5), cca(3)^2 + ccb(3)^2 - ccc(2)^2 - den(5)^2 - 2*ccc(1)*ccc(3) - 2*den(4)*den(6), 2*cca(3)*cca(4) + 2*ccb(3)*ccb(4) - 2*ccc(2)*ccc(3) - 2*den(5)*den(6), cca(4)^2 + ccb(4)^2 - ccc(3)^2 - den(6)^2];
