%cc_eq2 = [ 1, - m11 - m22, - m12^2 + m11*m22, - m33 - m44, - m13^2 - m14^2 - m23^2 - m24^2 + m11*m33 + m11*m44 + m22*m33 + m22*m44, m11*m23^2 + m11*m24^2 + m13^2*m22 + m14^2*m22 + m12^2*m33 + m12^2*m44 - 2*m12*m13*m23 - 2*m12*m14*m24 - m11*m22*m33 - m11*m22*m44, - m34^2 + m33*m44, m11*m34^2 + m14^2*m33 + m22*m34^2 + m13^2*m44 + m24^2*m33 + m23^2*m44 - 2*m13*m14*m34 - 2*m23*m24*m34 - m11*m33*m44 - m22*m33*m44, m12^2*m34^2 - m33*m44*m12^2 + 2*m44*m12*m13*m23 - 2*m12*m13*m24*m34 - 2*m12*m14*m23*m34 + 2*m33*m12*m14*m24 + m13^2*m24^2 - m22*m44*m13^2 - 2*m13*m14*m23*m24 + 2*m22*m13*m14*m34 + m14^2*m23^2 - m22*m33*m14^2 - m11*m44*m23^2 + 2*m11*m23*m24*m34 - m11*m33*m24^2 - m11*m22*m34^2 + m11*m22*m33*m44];
% [ g^2*l^2, g^2*l, g^2, g*l^2, g*l, g, l^2, l, 1]

%cc_eq1_g = [ cca(1)^2*l^2 + 2*cca(1)*cca(2)*l + cca(2)^2 + ccb(1)^2*l^2 + 2*ccb(1)*ccb(2)*l + ccb(2)^2 - den(1)^2*l^4 - 2*den(1)*den(2)*l^3 - 2*den(1)*den(3)*l^2 - den(2)^2*l^2 - 2*den(2)*den(3)*l - den(3)^2, 2*cca(2)*cca(4) + 2*ccb(2)*ccb(4) - 2*den(3)*den(6) + 2*cca(1)*cca(4)*l + 2*cca(2)*cca(3)*l + 2*ccb(1)*ccb(4)*l + 2*ccb(2)*ccb(3)*l - 2*den(2)*den(6)*l - 2*den(3)*den(5)*l + 2*cca(1)*cca(3)*l^2 + 2*ccb(1)*ccb(3)*l^2 - 2*den(1)*den(4)*l^4 - 2*den(1)*den(5)*l^3 - 2*den(1)*den(6)*l^2 - 2*den(2)*den(4)*l^3 - 2*den(2)*den(5)*l^2 - 2*den(3)*den(4)*l^2, cca(3)^2*l^2 + 2*cca(3)*cca(4)*l + cca(4)^2 + ccb(3)^2*l^2 + 2*ccb(3)*ccb(4)*l + ccb(4)^2 - ccc(1)^2*l^4 - 2*ccc(1)*ccc(2)*l^3 - 2*ccc(1)*ccc(3)*l^2 - ccc(2)^2*l^2 - 2*ccc(2)*ccc(3)*l - ccc(3)^2 - den(4)^2*l^4 - 2*den(4)*den(5)*l^3 - 2*den(4)*den(6)*l^2 - den(5)^2*l^2 - 2*den(5)*den(6)*l - den(6)^2];
%cc_eq2_g = [ m11*m22 - l*m22 - l*m11 + l^2 - m12^2, m11*m23^2 - l*m14^2 - l*m23^2 - l*m24^2 - l^2*m33 - l^2*m44 - l*m13^2 + m11*m24^2 + m13^2*m22 + m14^2*m22 + m12^2*m33 + m12^2*m44 + l*m11*m33 + l*m11*m44 + l*m22*m33 + l*m22*m44 - 2*m12*m13*m23 - 2*m12*m14*m24 - m11*m22*m33 - m11*m22*m44, m13^2*m24^2 - l^2*m34^2 + m14^2*m23^2 + m12^2*m34^2 + l*m11*m34^2 + l*m14^2*m33 + l*m22*m34^2 + l*m13^2*m44 + l*m24^2*m33 + l*m23^2*m44 + l^2*m33*m44 - m11*m22*m34^2 - m11*m24^2*m33 - m14^2*m22*m33 - m11*m23^2*m44 - m13^2*m22*m44 - m12^2*m33*m44 - 2*l*m13*m14*m34 - 2*l*m23*m24*m34 - l*m11*m33*m44 - l*m22*m33*m44 - 2*m13*m14*m23*m24 - 2*m12*m13*m24*m34 - 2*m12*m14*m23*m34 + 2*m12*m14*m24*m33 + 2*m13*m14*m22*m34 + 2*m11*m23*m24*m34 + 2*m12*m13*m23*m44 + m11*m22*m33*m44];
% [ g^2, g, 1]

bof1_cc1=[ -den(1)^2, -2*den(1)*den(2), cca(1)^2 + ccb(1)^2 - den(2)^2 - 2*den(1)*den(3), 2*cca(1)*cca(2) + 2*ccb(1)*ccb(2) - 2*den(2)*den(3), cca(2)^2 + ccb(2)^2 - den(3)^2];
bof1_cc2=[ -2*den(1)*den(4), - 2*den(1)*den(5) - 2*den(2)*den(4), 2*cca(1)*cca(3) + 2*ccb(1)*ccb(3) - 2*den(1)*den(6) - 2*den(2)*den(5) - 2*den(3)*den(4), 2*cca(1)*cca(4) + 2*cca(2)*cca(3) + 2*ccb(1)*ccb(4) + 2*ccb(2)*ccb(3) - 2*den(2)*den(6) - 2*den(3)*den(5), 2*cca(2)*cca(4) + 2*ccb(2)*ccb(4) - 2*den(3)*den(6)];
bof1_cc3=[ - ccc(1)^2 - den(4)^2, - 2*ccc(1)*ccc(2) - 2*den(4)*den(5), cca(3)^2 + ccb(3)^2 - ccc(2)^2 - den(5)^2 - 2*ccc(1)*ccc(3) - 2*den(4)*den(6), 2*cca(3)*cca(4) + 2*ccb(3)*ccb(4) - 2*ccc(2)*ccc(3) - 2*den(5)*den(6), cca(4)^2 + ccb(4)^2 - ccc(3)^2 - den(6)^2];
% [ l^4, l^3, l^2, l, 1]

bof2_cc1=[ 1, - m11 - m22, - m12^2 + m11*m22];
bof2_cc2=[ - m33 - m44, - m13^2 - m14^2 - m23^2 - m24^2 + m11*m33 + m11*m44 + m22*m33 + m22*m44, m11*m23^2 + m11*m24^2 + m13^2*m22 + m14^2*m22 + m12^2*m33 + m12^2*m44 - 2*m12*m13*m23 - 2*m12*m14*m24 - m11*m22*m33 - m11*m22*m44];
